import React from 'react';
import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
  NavBtn,
  NavBtnLink,
} from './NavbarDesign';
  
const Navbar = () => {
  return (
    <>
      <Nav>
        <Bars />
  
        <NavMenu>
          <NavLink to='/home' activeStyle>
            ACCUEIL
          </NavLink>
          <NavLink to='/carte' activeStyle>
            CARTE
          </NavLink>
          <NavLink to='/infos' activeStyle>
            INFORMATIONS
          </NavLink>
          
        </NavMenu>
        
      </Nav>
    </>
  );
};

export default Navbar;
